const Home = () => {
  return (
    <>
    <div>
      <h2>Welcome to Stopclock</h2>
      <img src="..\images\workout.jpeg" alt="Workout"/>
      <p>A stopclock in the gym isn’t just a timer — it’s your silent coach, sharpening every rep, every rest, and every second of focus. 
        Whether you’re hitting high-intensity intervals, managing precise rest periods, or pushing for that perfect plank hold, a clear and accurate stopclock keeps your workouts structured and intentional. 
        It helps you avoid guesswork, boosts your consistency, and ensures you’re making every minute count toward real progress. 
        With time on your side, you don’t just train harder — you train smarter. 
        Ready to unlock your best performance? Let the clock guide you.</p>
    </div>
    </>
  );
};

export default Home;
